<h2>Information Regarding Gulf County Foreclosures</h2>
<p>If you are interested in bidding on a foreclosed property, it is recommended that you come into the Clerk’s Office/Civil Division to physically review the files we have for each foreclosure. Foreclosure files are available for public inspection Monday through Friday, from 9:00 a.m. to 5:00 p.m. in the Civil Division of the Gulf County Clerk’s Office, Room 148, 1000 Cecil G. Costin, Sr., Blvd., Port St. Joe, Florida. Copies of the judgments and other documents may be obtained at $1.00 per page.</p>
<p><strong>THE CLERK’S OFFICE ASSUMES NO RESPONSIBILITY FOR ANY INACCURACY CONTAINED IN THE ORDERS.</strong> The Notice of Sale for each case is published in <em>The Star</em> newspaper once a week for two consecutive weeks prior to the sale.</p>
<p><strong>YOU MUST DO YOUR OWN RESEARCH</strong>. The order reflects a legal description of the property being foreclosed. With this description, you can find street address information at the Property Appraiser’s office located on the first floor of the Courthouse, or by visiting <a href="http://www.gulfpa.com/" target="_blank">www.gulfpa.com</a>. The property tax information can be found at the Tax Collector’s office located on the first floor of the Courthouse, or by visiting <a href="http://www.gulfcountytaxcollector.com/" target="_blank">www.gulfcountytaxcollector.com</a>.</p>
<p><strong>THE CLERK’S OFFICE ASSUMES NO RESPONSIBILITY FOR ANY ENCUMBRANCES (JUDGMENTS, MORTGAGES, TAXES, AND OTHER LIENS) ON ANY PROPERTY OFFERED FOR SALE</strong>. It is the responsibility of the interested party to do all research for the property involved<strong>, including whether any of the defendants has filed for bankruptcy protection.</strong> It is in your best interest to have a Title Search done by an Attorney or a Title Company; however, you may search the Official Records located in the Clerk’s Office.</p>
<p><strong>BIDDING:</strong> Bidding is handled by the Clerk’s Office. It is not possible to register to bid by mail. If you wish to bid on a foreclosed property, you must appear in person at the sale. Each bidder shall state his name, and each bidder acting in a representative capacity shall state whom he/she represents at the time of bidding. The successful bidder is required to immediately deposit 5% of their final bid, unless the judgment states otherwise (Florida Statutes 45.031). This deposit must be paid immediately following the sale and is a non-refundable deposit. If the successful bidder does not post the deposit as set forth above at the time of the sale, the bidder will be disqualified for that day, the bid will be considered invalid, the next highest bid will be accepted, and an announcement will be made to that effect. The balance of the bid must be paid by 5:00 p.m., E.T. on the same day of the sale. In addition, fees for documentary stamp tax (.70 per $100.00), Clerk’s fee for holding the sale ($70.00) and the Registry of the Court fee (3% for the first $500, and l.5% for each subsequent $l00, of the total amount deposited) must be paid by 5:00 p.m., E.T. on the same day as the sale. <strong>ALL MONEY PAID MUST BE CASH, CASHIER’S CHECK, MONEY ORDER OR BUSINESS CHECK DRAWN ON A UNITED STATES BANK ONLY. </strong>Checks must be made payable to: Gulf County Clerk of Court. <strong>Failure to pay the balance due and authorized costs by 5:00 p.m. the same day will result in the re-advertisement of the sale, the cost of which will be paid from the deposit. Any remaining funds will be applied towards the judgment.</strong></p>
<p><strong>OBJECTIONS</strong>: An objection to the sale may be filed by a party within 10 days. If objections are filed, the Judge will rule at a hearing as to whether or not a Certificate of Title is to be issued.</p>
<p><strong>REDEMPTION:</strong> The right of redemption ends upon the issuance of the Certificate of Title.</p>
<p><strong>CERTIFICATES</strong>: a <em>Certificate of Sale</em> is issued by the Clerk provided all proceeds are paid in full. A <em>Certificate of Title</em> is issued by the Clerk on the eleventh day after the sale. The defendant has ten days to object. If the tenth day is a non-business day, the next business day will be treated as the tenth day. If objections are filed, the Judge will rule as to the issuance. If the defendant files bankruptcy, the Clerk is stayed from issuing a Title or taking any action pending further Order of the Court.</p>
<p><em><strong>The Clerk’s Office is not authorized to give legal advice. If you require legal advice, you should obtain it from an attorney or some other source.</strong></em></p>
<p>If you have additional questions concerning the procedures for foreclosure sales held by the Clerk of Court, please contact our office at (850) 229-6112, ext. 1108.</p>

