ghest bid will be accepted, and an announcement will be made to that effect. The balance of the bid must be paid by 5:00 p.m., E.T. on the same day of the sale. In addition, fees for documentary stamp tax (.70 per $100.00), Clerk\u2019s fee for holding the sale ($70.00) and the Registry of the Court fee (3% for the first $500, and l.5% for each subsequent $l00, of the total amount deposited) must be paid by 5:00 p.m., E.T. on the same day as the sale.\u00a0&lt;strong&gt;ALL MONEY PAID MUST BE CASH, CASHIER\u2019S CHECK, MONEY ORDER OR BUSINESS CHECK DRAWN ON A UNITED STATES BANK ONLY.\u00a0&lt;\/strong&gt;Checks must be made payable to: Gulf County Clerk of Court.\u00a0&lt;strong&gt;Failure to pay the balance due and authorized costs by 5:00 p.m. the same day will result in the re-advertisement of the sale, the cost of which will be paid from the deposit. Any remaining funds will be applied towards the judgment.&lt;\/strong&gt;\r\n\r\n&lt;strong&gt;OBJECTIONS&lt;\/strong&gt;: An objection to the sale may be filed by a party within 10 days. If objections are filed, the Judge will rule at a hearing as to whether or not a Certificate of Title is to be issued.\r\n\r\n&lt;strong&gt;REDEMPTION:&lt;\/strong&gt;\u00a0The right of redemption ends upon the issuance of the Certificate of Title.\r\n\r\n&lt;strong&gt;CERTIFICATES&lt;\/strong&gt;: a\u00a0&lt;em&gt;Certificate of Sale&lt;\/em&gt;\u00a0is issued by the Clerk provided all proceeds are paid in full. A\u00a0&lt;em&gt;Certificate of Title&lt;\/em&gt;\u00a0is issued by the Clerk on the eleventh day after the sale. The defendant has ten days to object. If the tenth day is a non-business day, the next business day will be treated as the tenth day. If objections are filed, the Judge will rule as to the issuance. If the defendant files bankruptcy, the Clerk is stayed from issuing a Title or taking any action pending further Order of the Court.\r\n\r\n&lt;em&gt;&lt;strong&gt;The Clerk\u2019s Office is not authorized to give legal advice. If you require legal advice, you should obtain it from an attorney or some other source.&lt;\/strong&gt;&lt;\/em&gt;\r\n\r\nIf you have additional questions concerning the procedures for foreclosure sales held by the Clerk of Court, please contact our office at (850) 229-6112, ext. 1108.&quot;,&quot;post_title&quot;:&quot;Foreclosures&quot;,&quot;post_excerpt&quot;:&quot;&quot;,&quot;post_status&quot;:&quot;publish&quot;,&quot;comment_status&quot;:&quot;closed&quot;,&quot;ping_status&quot;:&quot;closed&quot;,&quot;post_password&quot;:&quot;&quot;,&quot;post_name&quot;:&quot;foreclosures&quot;,&quot;to_ping&quot;:&quot;&quot;,&quot;pinged&quot;:&quot;&quot;,&quot;post_modified&quot;:&quot;2018-10-04 17:39:22&quot;,&quot;post_modified_gmt&quot;:&quot;2018-10-04 17:39:22&quot;,&quot;post_content_filtered&quot;:&quot;&quot;,&quot;post_parent&quot;:47,&quot;guid&quot;:&quot;https:\/\/demo.gulfclerk.com\/?page_id=122&quot;,&quot;menu_order&quot;:16,&quot;post_type&quot;:&quot;page&quot;,&quot;post_mime_type&quot;:&quot;&quot;,&quot;comment_count&quot;:&quot;0&quot;,&quot;filter&quot;:&quot;raw&quot;}' ></expandable-sidebar>
